query QueryRenderersShowMoreInfoQuery(
  $showID: String!
) {
  show(id: $showID) {
    ...MoreInfo_show
    __id
  }
}

fragment MoreInfo_show on Show {
  _id
  id
  exhibition_period
  pressReleaseUrl
  partner {
    __typename
    ... on Partner {
      website
      type
    }
    ... on Node {
      __id
    }
    ... on ExternalPartner {
      __id
    }
  }
  press_release
  events {
    ...EventSection_event
  }
  __id
}

fragment EventSection_event on PartnerShowEventType {
  event_type
  description
  exhibitionPeriod
}
